css:
@-moz-document url-prefix('http://www.sjp.pwn.pl') {


.cn, .cs {
    -moz-border-bottom-colors: none;
    -moz-border-left-colors: none;
    -moz-border-right-colors: none;
    -moz-border-top-colors: none;
    background-color: #737E8C;
    border-color: -moz-use-text-color -moz-use-text-color #9AA3AD;
    border-image: none;
    border-style: none none solid;
    border-width: 0 0 1px;
}
.cs, .dn, .ds, .en, .fn, .gn, .hn {
    background-color: #9AA3AD;
}
.cn a, .cs a {
    font-size: 10px;
    text-transform: uppercase;
}
.dn, .ds {
    padding-left: 10px;
}
.en, .fn, .gn, .hn {
    height: 14px;
    padding-bottom: 1px;
    padding-left: 18px;
}
.fn {
    padding-left: 26px;
}
.gn {
    padding-left: 34px;
}
.hn {
    padding-left: 40px;
}
.dn, .ds, .en, .fn, .gn, .hn {
    font-size: 11px;
}
.ca {
    background-color: #B6BBC2;
}
.ca a, .ca a:hover {
    color: #454E54;
}
.cb {
    background-color: #C32A55;
}
.cc {
    background-color: #D67882;
}
.ca, .cc {
    border-color: white black;
}
.cd {
    background-color: #40A569;
}
.cn, .cs, .cd {
    padding-left: 2px;
}
.ce {
    background-color: #6DC091;
}
.cd, .ce {
    -moz-border-bottom-colors: none;
    -moz-border-left-colors: none;
    -moz-border-right-colors: none;
    -moz-border-top-colors: none;
    border-color: -moz-use-text-color -moz-use-text-color #D9ECE0;
    border-image: none;
    border-style: none none solid;
    border-width: 0 0 1px;
}
.ce a, .cf a {
    color: #2B5E3D;
}
.cf {
    background-color: #AFDCC1;
    border-color: #FFFFFF;
}
.cy {
    background-color: #40A569;
}
.cya {
    background-color: #85D295;
}
.ca, .cc, .cf {
    border-style: solid;
    border-width: 1px 0;
}
.cn, .cs, .dn, .ds, .cd {
    height: 21px;
    padding-bottom: 3px;
}
.cm {
    background-color: #444444;
}
.cma {
    background-color: #555555;
}
#lmenu a {
    color: #FFFFFF;
    text-decoration: none;
}
#lmenu a:hover {
    color: #FFFFFF;
    text-decoration: underline;
}

}
